import React, { Component } from 'react'

export class HouseForm extends Component {
    render() {
        return (
            <div>
                <form>
                    <div>
                        <label htmlFor="state">State: </label>
                        <input type="text" name="state" id="state" class="form-control" />
                    </div>

                </form>
            </div>
        )
    }
}

export default HouseForm
